import React, { useState, useLayoutEffect } from 'react';
import './App.css';
import Home from './Components/Home/Home';

function App() {
  const[elem, setELem] = useState({});
  useLayoutEffect(() => {
    fetch("/generateOne")
      .then((res) => res.json())
      .then((data) => setElem(data));
  }, []);
  return (
  	<div className="App">
    <h1>{elem}</h1>
  		<Home />
    }
  	</div>
  );
}
export default App;
